import React, { useState } from 'react'; 
import { Routes, Route, Link, useParams, useNavigate } from 'react-router-dom';

// Importiert die externen Komponenten
// Korrektur der Importpfade, um das 'components' Verzeichnis zu reflektieren:
import Home from './components/Home';
import Shop from './components/Shop';
import AdminDashboard from './components/AdminDashboard';
import AdminLogin from './components/AdminLogin';
import ProductDetail from './components/ProductDetail'; 

// Import des Contexts
// Da der Context NICHT im components-Ordner liegt, bleibt dieser Pfad erhalten:
import { CartProvider } from './contexts/CartContext';

// --- Konstanter Wert für das Admin-Passwort (NUR FRONTEND-SCHUTZ) ---
const ADMIN_PASSWORD = "stoffzauber2025"; 

// Wrapper für ProductDetail, um useParams und useNavigate zu nutzen
const ProductDetailWrapper = () => {
    const { productId } = useParams();
    const navigate = useNavigate();
    // Stelle sicher, dass die ProductDetail-Komponente über den korrekten Prop-Namen aufgerufen wird
    return <ProductDetail productId={productId} navigate={navigate} />; 
};

const BlogPage = () => (
  <div style={{ padding: '20px' }}>
    <h2>✂️ Andreas Nähtipps & Blog</h2>
    <p>Neueste Anleitungen und Inspirationen für kreative Nähprojekte.</p>
  </div>
);

// --- Haupt-App-Layout ---
function App() {
    // Zustand für die Admin-Authentifizierung
    const [isAdminAuthenticated, setIsAdminAuthenticated] = useState(false);

    // Funktion zum Setzen des Authentifizierungsstatus (wird an AdminLogin übergeben)
    const handleAdminLogin = (isAuthenticated) => {
        setIsAdminAuthenticated(isAuthenticated);
    };

    // Komponente zum bedingten Rendern/Schutz der Route
    const AdminProtectedRoute = ({ element: Element }) => {
        if (isAdminAuthenticated) {
            return <Element />;
        }
        // Übergibt die Login-Funktion an die AdminLogin-Komponente
        return <AdminLogin onLogin={handleAdminLogin} />;
    };

  return (
    <div className="App">
        {/* Warenkorb-Context muss die gesamte App umfassen, um `useCart` zu ermöglichen */}
        <CartProvider>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/shop">Shop</Link>
                <Link to="/blog">Blog</Link>
                {/* Admin-Link/Logout-Button */}
                {!isAdminAuthenticated ? (
                    <Link to="/admin">Admin-Login</Link>
                ) : (
                    <Link to="/" onClick={() => setIsAdminAuthenticated(false)} style={{ color: 'var(--farbe-akzent)' }}>
                        Admin-Logout
                    </Link>
                )}
            </nav>

            <main>
                <Routes>
                    <Route path="/" element={<Home />} /> 
                    <Route path="/shop" element={<Shop />} />
                    {/* Neue Route für Produktdetails */}
                    <Route path="/shop/:productId" element={<ProductDetailWrapper />} /> 
                    <Route path="/blog" element={<BlogPage />} />

                    {/* Geschützte Route für das Admin Dashboard */}
                    <Route path="/admin" element={<AdminProtectedRoute element={AdminDashboard} />} />

                    <Route path="*" element={<h2 style={{padding: '20px'}}>404 - Seite nicht gefunden</h2>} />
                </Routes>
            </main>

            <footer className="App-footer">
                © 2025 Henkes-Stoffzauber.de
            </footer>
        </CartProvider>
    </div>
  );
}

export default App;
